Rules.InvariantScript:
If(
    ThisItem.Required,
    If(
        IsBlank(Self.Text),
        Collect(
            WrongFields,
            {Code: ThisItem.Id}
        ),
        RemoveIf(
            WrongFields,
            Code = ThisItem.Id
        )
    )
)

Set(
    Reset,
    true
);
Set(
    Reset,
    false
);
Clear(WrongFields);
ForAll(
    AutoForm.Items,
    If(
        Required && IsBlank(Default),
        Collect(
            WrongFields,
            {Code: Id}
        )
    )
)
